import React, { Component } from 'react';
import logo from './logo.svg';
import './index.css';

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "Berkeley Social Club",
      location: "2050 University Ave",
      rating: 4,
      food: "Breakfast Food",
      price: "$$",
      picture: "https://www.berkeleyside.com/wp-content/uploads/2017/01/Berkeley-Social-Club-BI6A5607.jpg",
      liked: false
    };
    this.cardStyle = {
      background: "linear-gradient(180deg, rgba(255, 255, 255, 0) 0%, #FFFFFF 79.17%), url(" + this.state.picture + ")"
    };
  }

  upateData() {

  }

  render () {
    return (
      <div class="card" style={ this.cardStyle }>
            <h2 class="name">{this.state.name}</h2>
            <p class="type-cost">{this.state.food} | {this.state.price} | Rating: {this.state.rating}/5</p>
            <p class="address">{this.state.location}</p>
            <div class="match-buttons">
              <img src="assets/img/no.png"/>
              <img src="assets/img/yes.png"/>
            </div>
      </div>
    );
  }

}

export default Card;
